import React, { Component } from 'react';
import "./navbar.css";
import { Navbar, NavDropdown, Nav, Image } from "react-bootstrap";
import Logo from "../../assets/index.jpeg";
class Navbarweb extends Component {

    render() {
        return (
            <React.Fragment>

                <nav className="navbar navbar-expand-sm navbar-light bg-light">
                    <div className="container">                    <a href="#" className="navbar-brand">Company</a>


                        <button className="navbar-toggler" data-toggle="collapse" data-target="#navbaraid">
                            <span className="navbar-toggler-icon">

                            </span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbaraid">


                            <ul className=" navbar-nav ml-auto">
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                            </ul>


                        </div>
                    </div>
                </nav>

            </React.Fragment >
        );
    }


}
export default Navbarweb;
